settings.shader:
void main() {
  vec3 z = vec3(0.);
  vec3 o = vec3(1.);
  vec3 a = z;
  vec3 b = z;
  vec3 p = z;

  float cube = floor(vertexId/36.);
  float cubeVert = mod(vertexId,36.0);
  float face = floor(cubeVert/6.);
  float faceVert = mod(cubeVert,6.);
  if (face==0.) { a.x = 1.; b.z = 1.; }
  if (face==1.) { a.x = 1.; b.y = 1.; }
  if (face==2.) { a.x = 1.; b.y = 1.; p.z = 1.; }
  if (face==3.) { a.y = 1.; b.z = 1.; }
  if (face==4.) { a.y = 1.; b.z = 1.; p.x = 1.; }
  if (face==5.) { a.x = 1.; b.z = 1.; p.y = 1.; }
  if (faceVert>0. && faceVert<4.) p += a;
  if (faceVert>1. && faceVert<5.) p += b;
  p.z += 3.;
  p.y -= 2.;
  p.x -= .5;
  gl_Position = vec4(p.xy,1.0/-p.z,p.z);
  v_color = vec4(1.);
}
